import React from 'react'
import styled from 'styled-components';

const Form = styled.div`
  font-family: 'Mulish';
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  line-height: 20px;
`;

const FormInner = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: 14.56px 21.84px 5.46px;
  gap: 21.84px;

  position: relative;
  width: 446px;
  height: 219.21px;
  background: #FFFFFF;
  box-shadow: 0px 2.73px 7.28px rgba(132, 132, 134, 0.24);
  border-radius: 14.56px;
`;



function SearchWarranty(props) {
  return (props.trigger) ? (
    <Form>
        <FormInner>

        </FormInner>
    </Form>
  ) : "";
}

export default SearchWarranty
